function unitConversion(temperature, unit) {
    let result = 0;
    if (unit == "celcius") {
        result = Math.round((temperature-273.15)) + "°C";
    } else if (unit == "fahrenheit") {
        result = Math.round((temperature*(9/5)-459.67)) + "°F";

        
    }
    return result;
}

